import Home from './pages/Home';
import About from './pages/About';
import SingleCocktail from './pages/SingleCocktail';
import Error from './pages/Error';

//import componenets
import Navbar from './components/Navbar';

const App = () => {
  // const [posts, setPosts] = useState([]); 
