  //     setLoading(true); 
  //     const res = await axios.get('')
  //   }
  // })

  return (
    <Router>
      <Navbar />
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/about">
          <About />
        </Route>
        <Route path="/cocktail/:id/">
          <SingleCocktail />
        </Route>
        <Route path="*">
          <Error />
        </Route> 
      </Switch>
    </Router>

  );
}

export default App;
